import { Fragment } from "react";
import { Outlet, Link } from "react-router-dom";

const Navigation = () => {
  return (
    <Fragment>
      <div className="navigation">
        <Link>
          <div>Logo</div>
        </Link>
        <div className="links-container">
          <Link className="link" to='/shop'>
            SHOP
          </Link>
        </div>
        <h1>Navigation</h1>
      </div>
      <Outlet />
    </Fragment>
  );
};

export default Navigation;
